export default function SidebarAccountMenu() {
  const menus = [
    {
      title: "Overview",
      path: "/",
    },
    {
      title: "Validators",
      path: "/validators",
    },
    {
      title: "Delegations",
      path: "/delegations",
    },
    {
      title: "Transactions",
      path: "/tx",
    },
  ];
  return (
    <div className="sidebar-menu--vertical py-6 border-t-2 border-gray-200">
      <h4 className="text-gray-500 font-medium text-sm mb-3 px-6">Menu</h4>
      <ul>
        {menus.map((menu) => {
          return (
            <li>
              <a href={menu.path} className="px-6 py-3 block">
                {menu.title}
              </a>
            </li>
          );
        })}
      </ul>
    </div>
  );
}
